import React from "react";
import { Link } from "react-router-dom";

const NotFound = () => (
  <div className="container m-5 p-5">
    <div className="card bg-subtle shadow-lg">
      <h1>404 - Not Found!</h1>
      <Link to="/">Go Home</Link>
    </div>
  </div>
);

export default NotFound;
